/**
 * @brief 填充整个屏幕
 *
 * 使用指定的颜色填充整个屏幕。
 *
 * @param c 填充颜色
 */
void UG_FillScreen( UG_COLOR c )
{
   UG_FillFrame(0,0,gui->x_dim-1,gui->y_dim-1,c);
}

/**
 * @brief 填充指定矩形区域内的像素点
 *
 * 使用指定的颜色填充由 (x1, y1) 和 (x2, y2) 定义的矩形区域。
 * 如果硬件加速可用，则优先使用硬件加速进行填充；否则，使用软件填充方式。
 *
 * @param x1 矩形区域的左上角 x 坐标
 * @param y1 矩形区域的左上角 y 坐标
 * @param x2 矩形区域的右下角 x 坐标
 * @param y2 矩形区域的右下角 y 坐标
 * @param c 要填充的颜色
 */
void UG_FillFrame( UG_S16 x1, UG_S16 y1, UG_S16 x2, UG_S16 y2, UG_COLOR c )
{
   UG_S16 n,m;

   if ( x2 < x1 )
   {
      n = x2;
      x2 = x1;
      x1 = n;
   }
   if ( y2 < y1 )
   {
      n = y2;
      y2 = y1;
      y1 = n;
   }

   /* Is hardware acceleration available? */
   if ( gui->driver[DRIVER_FILL_FRAME].state & DRIVER_ENABLED )
   {
      if( ((UG_RESULT(*)(UG_S16 x1, UG_S16 y1, UG_S16 x2, UG_S16 y2, UG_COLOR c))gui->driver[DRIVER_FILL_FRAME].driver)(x1,y1,x2,y2,c) == UG_RESULT_OK ) return;
   }

   for( m=y1; m<=y2; m++ )
   {
      for( n=x1; n<=x2; n++ )
      {
         gui->pset(n,m,c);
      }
   }
}

/**
 * @brief 在指定矩形区域内绘制一个圆角矩形
 *
 * 使用给定的颜色在指定矩形区域内绘制一个圆角矩形。
 *
 * @param x1 矩形左上角的 x 坐标
 * @param y1 矩形左上角的 y 坐标
 * @param x2 矩形右下角的 x 坐标
 * @param y2 矩形右下角的 y 坐标
 * @param r 圆角矩形的圆角半径
 * @param c 绘制圆角矩形使用的颜色
 */
void UG_FillRoundFrame( UG_S16 x1, UG_S16 y1, UG_S16 x2, UG_S16 y2, UG_S16 r, UG_COLOR c )
{
   UG_S16  x,y,xd;

   if ( x2 < x1 )
   {
      x = x2;
      x2 = x1;
      x1 = x;
   }
   if ( y2 < y1 )
   {
      y = y2;
      y2 = y1;
      y1 = y;
   }

   if ( r<=0 ) return;

   xd = 3 - (r << 1);
   x = 0;
   y = r;

   UG_FillFrame(x1 + r, y1, x2 - r, y2, c);

   while ( x <= y )
   {
     if( y > 0 )
     {
        UG_DrawLine(x2 + x - r, y1 - y + r, x2+ x - r, y + y2 - r, c);
        UG_DrawLine(x1 - x + r, y1 - y + r, x1- x + r, y + y2 - r, c);
     }
     if( x > 0 )
     {
        UG_DrawLine(x1 - y + r, y1 - x + r, x1 - y + r, x + y2 - r, c);
        UG_DrawLine(x2 + y - r, y1 - x + r, x2 + y - r, x + y2 - r, c);
     }
     if ( xd < 0 )
     {
        xd += (x << 2) + 6;
     }
     else
     {
        xd += ((x - y) << 2) + 10;
        y--;
     }
     x++;
   }
}

/**
 * @brief 绘制网格
 *
 * 在指定区域内绘制网格。
 *
 * @param x1 网格左上角横坐标
 * @param y1 网格左上角纵坐标
 * @param x2 网格右下角横坐标
 * @param y2 网格右下角纵坐标
 * @param c   网格颜色
 */
void UG_DrawMesh( UG_S16 x1, UG_S16 y1, UG_S16 x2, UG_S16 y2, UG_COLOR c )
{
   UG_S16 n,m;

   if ( x2 < x1 )
   {
      n = x2;
      x2 = x1;
      x1 = n;
   }
   if ( y2 < y1 )
   {
      n = y2;
      y2 = y1;
      y1 = n;
   }

   for( m=y1; m<=y2; m+=2 )
   {
      for( n=x1; n<=x2; n+=2 )
      {
         gui->pset(n,m,c);
      }
   }
}

/**
 * @brief 绘制矩形框
 *
 * 使用给定的颜色和坐标绘制一个矩形框。
 *
 * @param x1 矩形左上角的 x 坐标
 * @param y1 矩形左上角的 y 坐标
 * @param x2 矩形右下角的 x 坐标
 * @param y2 矩形右下角的 y 坐标
 * @param c 用于绘制矩形框的颜色
 */
void UG_DrawFrame( UG_S16 x1, UG_S16 y1, UG_S16 x2, UG_S16 y2, UG_COLOR c )
{
   UG_DrawLine(x1,y1,x2,y1,c);
   UG_DrawLine(x1,y2,x2,y2,c);
   UG_DrawLine(x1,y1,x1,y2,c);
   UG_DrawLine(x2,y1,x2,y2,c);
}

/**
 * @brief 在指定区域内绘制圆角矩形框
 *
 * 在指定的矩形区域内绘制一个圆角矩形框。如果矩形宽度或高度小于圆角半径，则不绘制。
 *
 * @param x1 矩形左上角的 x 坐标
 * @param y1 矩形左上角的 y 坐标
 * @param x2 矩形右下角的 x 坐标
 * @param y2 矩形右下角的 y 坐标
 * @param r 圆角的半径
 * @param c 绘制颜色
 */
void UG_DrawRoundFrame( UG_S16 x1, UG_S16 y1, UG_S16 x2, UG_S16 y2, UG_S16 r, UG_COLOR c )
{
   UG_S16 n;
   if ( x2 < x1 )
   {
      n = x2;
      x2 = x1;
      x1 = n;
   }
   if ( y2 < y1 )
   {
      n = y2;
      y2 = y1;
      y1 = n;
   }

   if ( r > x2 ) return;
   if ( r > y2 ) return;

   UG_DrawLine(x1+r, y1, x2-r, y1, c);
   UG_DrawLine(x1+r, y2, x2-r, y2, c);
   UG_DrawLine(x1, y1+r, x1, y2-r, c);
   UG_DrawLine(x2, y1+r, x2, y2-r, c);
   UG_DrawArc(x1+r, y1+r, r, 0x0C, c);
   UG_DrawArc(x2-r, y1+r, r, 0x03, c);
   UG_DrawArc(x1+r, y2-r, r, 0x30, c);
   UG_DrawArc(x2-r, y2-r, r, 0xC0, c);
}

/**
 * @brief 在指定位置绘制一个像素点
 *
 * 使用指定的颜色在指定位置绘制一个像素点。
 *
 * @param x0 像素点的x坐标
 * @param y0 像素点的y坐标
 * @param c 像素点的颜色
 */
void UG_DrawPixel( UG_S16 x0, UG_S16 y0, UG_COLOR c )
{
   gui->pset(x0,y0,c);
}

/**
 * @brief 在指定位置绘制一个圆形
 *
 * 使用Bresenham中点圆算法绘制一个圆形。
 *
 * @param x0 圆心的x坐标
 * @param y0 圆心的y坐标
 * @param r 圆的半径
 * @param c 圆的颜色
 */
void UG_DrawCircle( UG_S16 x0, UG_S16 y0, UG_S16 r, UG_COLOR c )
{
   UG_S16 x,y,xd,yd,e;

   if ( x0<0 ) return;
   if ( y0<0 ) return;
   if ( r<=0 ) return;

   xd = 1 - (r << 1);
   yd = 0;
   e = 0;
   x = r;
   y = 0;

   while ( x >= y )
   {
      gui->pset(x0 - x, y0 + y, c);
      gui->pset(x0 - x, y0 - y, c);
      gui->pset(x0 + x, y0 + y, c);
      gui->pset(x0 + x, y0 - y, c);
      gui->pset(x0 - y, y0 + x, c);
      gui->pset(x0 - y, y0 - x, c);
      gui->pset(x0 + y, y0 + x, c);
      gui->pset(x0 + y, y0 - x, c);

      y++;
      e += yd;
      yd += 2;
      if ( ((e << 1) + xd) > 0 )
      {
         x--;
         e += xd;
         xd += 2;
      }
   }
}

/**
 * @brief 填充一个圆
 *
 * 使用中点圆生成算法填充一个指定位置和半径的圆。
 *
 * @param x0 圆的中心点的x坐标
 * @param y0 圆的中心点的y坐标
 * @param r 圆的半径
 * @param c 圆的颜色
 */
void UG_FillCircle( UG_S16 x0, UG_S16 y0, UG_S16 r, UG_COLOR c )
{
   UG_S16  x,y,xd;

   if ( x0<0 ) return;
   if ( y0<0 ) return;
   if ( r<=0 ) return;

   xd = 3 - (r << 1);
   x = 0;
   y = r;

   while ( x <= y )
   {
     if( y > 0 )
     {
        UG_DrawLine(x0 - x, y0 - y,x0 - x, y0 + y, c);
        UG_DrawLine(x0 + x, y0 - y,x0 + x, y0 + y, c);
     }
     if( x > 0 )
     {
        UG_DrawLine(x0 - y, y0 - x,x0 - y, y0 + x, c);
        UG_DrawLine(x0 + y, y0 - x,x0 + y, y0 + x, c);
     }
     if ( xd < 0 )
     {
        xd += (x << 2) + 6;
     }
     else
     {
        xd += ((x - y) << 2) + 10;
        y--;
     }
     x++;
   }
   UG_DrawCircle(x0, y0, r,c);
}

/**
 * @brief 在图形界面上绘制圆弧
 *
 * 在指定的坐标和半径处绘制一个圆弧。圆弧的绘制由参数s控制，可以绘制四分之一圆弧、半圆弧或完整圆弧。
 *
 * @param x0 圆弧中心的x坐标
 * @param y0 圆弧中心的y坐标
 * @param r 圆弧的半径
 * @param s 控制圆弧绘制的位掩码，每一位代表一个象限，1表示绘制该象限的圆弧
 *        - 0x01: 第一象限（Q1）
 *        - 0x02: 第二象限（Q2）
 *        - 0x04: 第三象限（Q3）
 *        - 0x08: 第四象限（Q4）
 *        - 0x10: 第一和第三象限
 *        - 0x20: 第二和第四象限
 *        - 0x30: 完整上半圆
 *        - 0xC0: 完整下半圆
 *        - 0xFF: 完整圆
 * @param c 圆弧的颜色
 */
void UG_DrawArc( UG_S16 x0, UG_S16 y0, UG_S16 r, UG_U8 s, UG_COLOR c )
{
   UG_S16 x,y,xd,yd,e;

   if ( x0<0 ) return;
   if ( y0<0 ) return;
   if ( r<=0 ) return;

   xd = 1 - (r << 1);
   yd = 0;
   e = 0;
   x = r;
   y = 0;

   while ( x >= y )
   {
      // Q1
      if ( s & 0x01 ) gui->pset(x0 + x, y0 - y, c);
      if ( s & 0x02 ) gui->pset(x0 + y, y0 - x, c);

      // Q2
      if ( s & 0x04 ) gui->pset(x0 - y, y0 - x, c);
      if ( s & 0x08 ) gui->pset(x0 - x, y0 - y, c);

      // Q3
      if ( s & 0x10 ) gui->pset(x0 - x, y0 + y, c);
      if ( s & 0x20 ) gui->pset(x0 - y, y0 + x, c);

      // Q4
      if ( s & 0x40 ) gui->pset(x0 + y, y0 + x, c);
      if ( s & 0x80 ) gui->pset(x0 + x, y0 + y, c);

      y++;
      e += yd;
      yd += 2;
      if ( ((e << 1) + xd) > 0 )
      {
         x--;
         e += xd;
         xd += 2;
      }
   }
}

/**
 * @brief 绘制一条线段
 *
 * 使用 Bresenham 算法绘制从点 (x1, y1) 到点 (x2, y2) 的线段，并使用给定的颜色填充。
 * 如果图形驱动支持硬件加速绘制线段，则优先使用硬件加速。
 *
 * @param x1 线段起点的 x 坐标
 * @param y1 线段起点的 y 坐标
 * @param x2 线段终点的 x 坐标
 * @param y2 线段终点的 y 坐标
 * @param c 线段的颜色
 */
void UG_DrawLine( UG_S16 x1, UG_S16 y1, UG_S16 x2, UG_S16 y2, UG_COLOR c )
{
   UG_S16 n, dx, dy, sgndx, sgndy, dxabs, dyabs, x, y, drawx, drawy;

   /* Is hardware acceleration available? */
   if ( gui->driver[DRIVER_DRAW_LINE].state & DRIVER_ENABLED )
   {
      if( ((UG_RESULT(*)(UG_S16 x1, UG_S16 y1, UG_S16 x2, UG_S16 y2, UG_COLOR c))gui->driver[DRIVER_DRAW_LINE].driver)(x1,y1,x2,y2,c) == UG_RESULT_OK ) return;
   }

   dx = x2 - x1;
   dy = y2 - y1;
   dxabs = (dx>0)?dx:-dx;
   dyabs = (dy>0)?dy:-dy;
   sgndx = (dx>0)?1:-1;
   sgndy = (dy>0)?1:-1;
   x = dyabs >> 1;
   y = dxabs >> 1;
   drawx = x1;
   drawy = y1;

   gui->pset(drawx, drawy,c);

   if( dxabs >= dyabs )
   {
      for( n=0; n<dxabs; n++ )
      {
         y += dyabs;
         if( y >= dxabs )
         {
            y -= dxabs;
            drawy += sgndy;
         }
         drawx += sgndx;
         gui->pset(drawx, drawy,c);
      }
   }
   else
   {
      for( n=0; n<dyabs; n++ )
      {
         x += dxabs;
         if( x >= dyabs )
         {
            x -= dyabs;
            drawx += sgndx;
         }
         drawy += sgndy;
         gui->pset(drawx, drawy,c);
      }
   }  
}

/**
 * @brief 在指定位置绘制字符串
 *
 * 在指定的坐标位置绘制字符串。如果字符串包含换行符，则在换行处开始新的一行。
 *
 * @param x 字符串起始位置的 x 坐标
 * @param y 字符串起始位置的 y 坐标
 * @param str 要绘制的字符串
 */
void UG_PutString( UG_S16 x, UG_S16 y, char* str )
{
   UG_S16 xp,yp;
   UG_U8 cw;
   char chr;

   xp=x;
   yp=y;

   while ( *str != 0 )
   {
      chr = *str++;
	  if (chr < gui->font.start_char || chr > gui->font.end_char) continue;
      if ( chr == '\n' )
      {
         xp = gui->x_dim;
         continue;
      }
	  cw = gui->font.widths ? gui->font.widths[chr - gui->font.start_char] : gui->font.char_width;

      if ( xp + cw > gui->x_dim - 1 )
      {
         xp = x;
         yp += gui->font.char_height+gui->char_v_space;
      }

      UG_PutChar(chr, xp, yp, gui->fore_color, gui->back_color);

      xp += cw + gui->char_h_space;
   }
}

/**
 * @brief 在指定位置绘制单个字符
 *
 * 在指定位置绘制单个字符，使用指定的前景色和背景色。
 *
 * @param chr 要绘制的字符
 * @param x 字符的X坐标
 * @param y 字符的Y坐标
 * @param fc 前景色
 * @param bc 背景色
 */
void UG_PutChar( char chr, UG_S16 x, UG_S16 y, UG_COLOR fc, UG_COLOR bc )
{
	_UG_PutChar(chr,x,y,fc,bc,&gui->font);
}

/**
 * @brief 向控制台输出字符串
 *
 * 该函数负责将传入的字符串在控制台界面上逐字符显示。
 *
 * @param str 指向要输出的字符串的指针
 */
void UG_ConsolePutString( char* str )
{
   char chr;
   UG_U8 cw;

   while ( *str != 0 )
   {
      chr = *str;
      if ( chr == '\n' )
      {
         gui->console.x_pos = gui->x_dim;
         str++;
         continue;
      }
      
      cw = gui->font.widths ? gui->font.widths[chr - gui->font.start_char] : gui->font.char_width;
      gui->console.x_pos += cw+gui->char_h_space;

      if ( gui->console.x_pos+cw > gui->console.x_end )
      {
         gui->console.x_pos = gui->console.x_start;
         gui->console.y_pos += gui->font.char_height+gui->char_v_space;
      }
      if ( gui->console.y_pos+gui->font.char_height > gui->console.y_end )
      {
         gui->console.x_pos = gui->console.x_start;
         gui->console.y_pos = gui->console.y_start;
         UG_FillFrame(gui->console.x_start,gui->console.y_start,gui->console.x_end,gui->console.y_end,gui->console.back_color);
      }

      UG_PutChar(chr, gui->console.x_pos, gui->console.y_pos, gui->console.fore_color, gui->console.back_color);
      str++;
   }
}

