/**
 * @brief 注册GUI驱动
 *
 * 根据给定的驱动类型注册相应的GUI驱动。
 *
 * @param type 驱动类型，其值应在0到NUMBER_OF_DRIVERS-1之间。
 * @param driver 要注册的驱动函数的指针。
 */
void UG_DriverRegister( UG_U8 type, void* driver )
{
   if ( type >= NUMBER_OF_DRIVERS ) return;

   gui->driver[type].driver = driver;
   gui->driver[type].state = DRIVER_REGISTERED | DRIVER_ENABLED;
}

/**
 * @brief 启用指定类型的驱动程序
 *
 * 启用指定类型的驱动程序。
 *
 * @param type 驱动程序类型
 *
 * @return 无返回值
 */
void UG_DriverEnable( UG_U8 type )
{
   if ( type >= NUMBER_OF_DRIVERS ) return;
   if ( gui->driver[type].state & DRIVER_REGISTERED )
   {
      gui->driver[type].state |= DRIVER_ENABLED;
   }
}

/**
 * @brief 禁用指定类型的驱动程序
 *
 * 禁用指定类型的驱动程序，如果该类型的驱动程序已注册且当前处于启用状态，则将其禁用。
 *
 * @param type 要禁用的驱动程序类型
 *
 * @return 无返回值
 */
void UG_DriverDisable( UG_U8 type )
{
   if ( type >= NUMBER_OF_DRIVERS ) return;
   if ( gui->driver[type].state & DRIVER_REGISTERED )
   {
      gui->driver[type].state &= ~DRIVER_ENABLED;
   }
}

