/* -- MISCELLANEOUS FUNCTIONS                                                    -- */
/* -------------------------------------------------------------------------------- */
/**
 * @brief 更新用户界面图形库
 *
 * 此函数负责更新用户界面图形库中的状态和信息。
 *
 * @details
 * 函数首先检查是否有窗口等待更新。如果有，它会清除等待更新标志。
 * 接着，它会跟踪活动窗口和下一个窗口，如果两者不同，则会更新活动窗口的状态，
 * 并根据需要重绘上一个窗口的标题。
 *
 * 然后，函数会检查是否有活动窗口。如果有，它会检查该窗口是否需要更新。
 * 如果需要，它会调用 _UG_WindowUpdate 函数来更新窗口。
 * 如果窗口是可见的，它还会处理触摸数据、更新对象并处理事件。
 */
void UG_Update( void )
{
   UG_WINDOW* wnd;

   /* 是否有人在等待这个更新？ */
   /* Is somebody waiting for this update? */
   if ( gui->state & UG_SATUS_WAIT_FOR_UPDATE ) gui->state &= ~UG_SATUS_WAIT_FOR_UPDATE;

   /* 跟踪窗口 */
   /* Keep track of the windows */
   if ( gui->next_window != gui->active_window )
   {
      if ( gui->next_window != NULL )
      {
         gui->last_window = gui->active_window;
         gui->active_window = gui->next_window;

         /* 是否需要绘制一个非活动的标题？ */
         /* Do we need to draw an inactive title? */
         if ((gui->last_window != NULL) && (gui->last_window->style & WND_STYLE_SHOW_TITLE) && (gui->last_window->state & WND_STATE_VISIBLE) )
         {
            /* 两个窗口的大小是否不同 */
            /* Do both windows differ in size */
            if ( (gui->last_window->xs != gui->active_window->xs) || (gui->last_window->xe != gui->active_window->xe) || (gui->last_window->ys != gui->active_window->ys) || (gui->last_window->ye != gui->active_window->ye) )
            {
               /* 重新绘制上一个窗口的标题 */
               /* Redraw title of the last window */
               _UG_WindowDrawTitle( gui->last_window );
            }
         }
         gui->active_window->state &= ~WND_STATE_REDRAW_TITLE;
         gui->active_window->state |= WND_STATE_UPDATE | WND_STATE_VISIBLE;
      }
   }

   /* 是否有活动的窗口 */
   /* Is there an active window */
   if ( gui->active_window != NULL )
   {
      wnd = gui->active_window;

      /* 窗口是否需要更新？ */
      /* Does the window need to be updated? */
      if ( wnd->state & WND_STATE_UPDATE )
      {
         /* 执行更新 */
         /* Do it! */
         _UG_WindowUpdate( wnd );
      }

      /* 窗口是否可见？ */
      /* Is the window visible? */
      if ( wnd->state & WND_STATE_VISIBLE )
      {
         _UG_ProcessTouchData( wnd );
         _UG_UpdateObjects( wnd );
         _UG_HandleEvents( wnd );
      }
   }
}

/**
 * @brief 等待更新
 *
 * 该函数用于等待图形用户界面的更新。它会将GUI的状态设置为等待更新，并根据是否启用了多任务处理来执行不同的等待逻辑。
 *
 * @details
 * 1. 设置GUI的状态为等待更新。
 * 2. 如果定义了USE_MULTITASKING宏，则使用volatile关键字确保状态变量的可见性，并在状态变为非等待更新时退出循环。
 * 3. 如果没有定义USE_MULTITASKING宏，则直接检查状态变量并在状态变为非等待更新时退出循环。
 */
void UG_WaitForUpdate( void )
{
   gui->state |= UG_SATUS_WAIT_FOR_UPDATE;
   #ifdef USE_MULTITASKING    
   while ( (volatile UG_U8)gui->state & UG_SATUS_WAIT_FOR_UPDATE ){};
   #endif    
   #ifndef USE_MULTITASKING    
   while ( (UG_U8)gui->state & UG_SATUS_WAIT_FOR_UPDATE ){};
   #endif    
}

/**
 * @brief 在指定位置绘制位图
 *
 * 该函数在指定的位置绘制一个位图。目前仅支持16位每像素（BPP）的位图格式。
 *
 * @param xp 位图的起始x坐标
 * @param yp 位图的起始y坐标
 * @param bmp 指向位图数据的指针
 */
void UG_DrawBMP( UG_S16 xp, UG_S16 yp, UG_BMP* bmp )
{
   UG_S16 x,y,xs;
   UG_U8 r,g,b;
   UG_U16* p;
   UG_U16 tmp;
   UG_COLOR c;

   if ( bmp->p == NULL ) return;

   /* Only support 16 BPP so far */
   if ( bmp->bpp == BMP_BPP_16 )
   {
      p = (UG_U16*)bmp->p;
   }
   else
   {
      return;
   }

   xs = xp;
   for(y=0;y<bmp->height;y++)
   {
      xp = xs;
      for(x=0;x<bmp->width;x++)
      {
         tmp = *p++;
         /* Convert RGB565 to RGB888 */
         r = (tmp>>11)&0x1F;
         r<<=3;
         g = (tmp>>5)&0x3F;
         g<<=2;
         b = (tmp)&0x1F;
         b<<=3;
         c = ((UG_COLOR)r<<16) | ((UG_COLOR)g<<8) | (UG_COLOR)b;
         UG_DrawPixel( xp++ , yp , c );
      }
      yp++;
   }
}

/**
 * @brief 更新触摸信息
 *
 * 该函数用于更新触摸位置及其状态信息。
 *
 * @param xp 触摸位置的x坐标
 * @param yp 触摸位置的y坐标
 * @param state 触摸状态，0表示触摸按下，1表示触摸释放
 */
void UG_TouchUpdate( UG_S16 xp, UG_S16 yp, UG_U8 state )
{
   gui->touch.xp = xp;
   gui->touch.yp = yp;
   gui->touch.state = state;
}

