/**
 * @brief 设置窗口标题文本的字体
 *
 * 设置指定窗口的标题文本的字体。如果窗口状态有效，则更新窗口状态并设置字体。
 * 如果新字体的高度超过当前标题栏高度，则更新标题栏高度并重新绘制标题。
 *
 * @param wnd 指向窗口的指针
 * @param font 指向字体的指针
 *
 * @return 返回值，成功返回UG_RESULT_OK，失败返回UG_RESULT_FAIL
 */
UG_RESULT UG_WindowSetTitleTextFont( UG_WINDOW* wnd, const UG_FONT* font )
{
   if ( (wnd != NULL) && (wnd->state & WND_STATE_VALID) )
   {
      wnd->state |= WND_STATE_UPDATE | WND_STATE_REDRAW_TITLE;
      wnd->title.font = font;
      if ( wnd->title.height <= (font->char_height + 1) )
      {
         wnd->title.height = font->char_height + 2;
         wnd->state &= ~WND_STATE_REDRAW_TITLE;
      }
      return UG_RESULT_OK;
   }
   return UG_RESULT_FAIL;
}

