/**
 * @brief 设置窗口样式
 *
 * 设置指定窗口的样式，包括是否为3D窗口以及是否显示标题栏。
 *
 * @param wnd 指向窗口对象的指针
 * @param style 窗口样式，可以为以下值的组合：
 *              - WND_STYLE_3D：表示窗口为3D窗口
 *              - WND_STYLE_SHOW_TITLE：表示显示标题栏
 *
 * @return 返回UG_RESULT_OK表示设置成功，返回UG_RESULT_FAIL表示设置失败
 *
 * @note 在调用此函数之前，需要确保窗口对象有效且处于有效状态
 */
UG_RESULT UG_WindowSetStyle( UG_WINDOW* wnd, UG_U8 style )
{
   if ( (wnd != NULL) && (wnd->state & WND_STATE_VALID) )
   {
      /* 3D or 2D? */
      if ( style & WND_STYLE_3D )
      {
         wnd->style |= WND_STYLE_3D;
      }
      else
      {
         wnd->style &= ~WND_STYLE_3D;
      }
      /* Show title-bar? */
      if ( style & WND_STYLE_SHOW_TITLE )
      {
         wnd->style |= WND_STYLE_SHOW_TITLE;
      }
      else
      {
         wnd->style &= ~WND_STYLE_SHOW_TITLE;
      }
      wnd->state |= WND_STATE_UPDATE;
      return UG_RESULT_OK;
   }
   return UG_RESULT_FAIL;
}

