/* -- Checkbox FUNCTIONS                                                           -- */
/* -------------------------------------------------------------------------------- */
/**
 * @brief 创建一个复选框对象
 *
 * 在指定的窗口内创建一个复选框对象，并初始化其相关参数。
 *
 * @param wnd 指向窗口对象的指针
 * @param chb 指向复选框对象的指针
 * @param id 复选框的唯一标识符
 * @param xs 复选框矩形区域的左上角 x 坐标
 * @param ys 复选框矩形区域的左上角 y 坐标
 * @param xe 复选框矩形区域的右下角 x 坐标
 * @param ye 复选框矩形区域的右下角 y 坐标
 *
 * @return 函数执行结果，成功返回 UG_RESULT_OK，失败返回 UG_RESULT_FAIL
 */
UG_RESULT UG_CheckboxCreate( UG_WINDOW* wnd, UG_CHECKBOX* chb, UG_U8 id, UG_S16 xs, UG_S16 ys, UG_S16 xe, UG_S16 ye )
{
   UG_OBJECT* obj;

   obj = _UG_GetFreeObject( wnd );
   if ( obj == NULL ) return UG_RESULT_FAIL;

   /* Initialize object-specific parameters */
   chb->state = CHB_STATE_RELEASED;
   chb->bc = wnd->bc;
   chb->fc = wnd->fc;
   chb->abc = wnd->bc;
   chb->afc = wnd->fc;
   chb->style = CHB_STYLE_3D;
   chb->align = ALIGN_TOP_LEFT;
   if (gui != NULL) chb->font = &gui->font;
   else chb->font = NULL;
   chb->str = "-";
   chb->checked = 0; 

   /* Initialize standard object parameters */
   obj->update = _UG_CheckboxUpdate;
   obj->touch_state = OBJ_TOUCH_STATE_INIT;
   obj->type = OBJ_TYPE_CHECKBOX;
   obj->event = OBJ_EVENT_NONE;
   obj->a_rel.xs = xs;
   obj->a_rel.ys = ys;
   obj->a_rel.xe = xe;
   obj->a_rel.ye = ye;
   obj->a_abs.xs = -1;
   obj->a_abs.ys = -1;
   obj->a_abs.xe = -1;
   obj->a_abs.ye = -1;
   obj->id = id;
   obj->state |= OBJ_STATE_VISIBLE | OBJ_STATE_REDRAW | OBJ_STATE_VALID | OBJ_STATE_TOUCH_ENABLE;
   obj->data = (void*)chb;

   /* Update function: Do your thing! */
   obj->state &= ~OBJ_STATE_FREE;

   return UG_RESULT_OK;
}

