/**
 * @brief 创建一个文本框对象
 *
 * 该函数用于在指定窗口中创建一个文本框对象，并初始化其相关参数。
 *
 * @param wnd 指向窗口对象的指针
 * @param txb 指向文本框对象的指针
 * @param id 文本框的唯一标识符
 * @param xs 文本框左上角的 x 坐标（相对坐标）
 * @param ys 文本框左上角的 y 坐标（相对坐标）
 * @param xe 文本框右下角的 x 坐标（相对坐标）
 * @param ye 文本框右下角的 y 坐标（相对坐标）
 *
 * @return 创建结果，成功返回 UG_RESULT_OK，失败返回 UG_RESULT_FAIL
 */
UG_RESULT UG_TextboxCreate( UG_WINDOW* wnd, UG_TEXTBOX* txb, UG_U8 id, UG_S16 xs, UG_S16 ys, UG_S16 xe, UG_S16 ye )
{
   UG_OBJECT* obj;

   obj = _UG_GetFreeObject( wnd );
   if ( obj == NULL ) return UG_RESULT_FAIL;

   /* Initialize object-specific parameters */
   txb->str = NULL;
   if (gui != NULL) txb->font = &gui->font;
   else txb->font = NULL;
   txb->style = 0; /* reserved */
   txb->fc = wnd->fc;
   txb->bc = wnd->bc;
   txb->align = ALIGN_CENTER;
   txb->h_space = 0;
   txb->v_space = 0;

   /* Initialize standard object parameters */
   obj->update = _UG_TextboxUpdate;
   obj->touch_state = OBJ_TOUCH_STATE_INIT;
   obj->type = OBJ_TYPE_TEXTBOX;
   obj->event = OBJ_EVENT_NONE;
   obj->a_rel.xs = xs;
   obj->a_rel.ys = ys;
   obj->a_rel.xe = xe;
   obj->a_rel.ye = ye;
   obj->a_abs.xs = -1;
   obj->a_abs.ys = -1;
   obj->a_abs.xe = -1;
   obj->a_abs.ye = -1;
   obj->id = id;
   obj->state |= OBJ_STATE_VISIBLE | OBJ_STATE_REDRAW | OBJ_STATE_VALID;
   obj->data = (void*)txb;

   /* Update function: Do your thing! */
   obj->state &= ~OBJ_STATE_FREE;

   return UG_RESULT_OK;
}

